import React, { Component } from 'react'
import {
  Grid
} from '@material-ui/core'
import { connect } from 'react-redux'
import compose from 'recompose/compose'
import Fab from '@material-ui/core/Fab'
// import image from '../assets/modelX.png'
import modelS from '../assets/modelS.png'
import whiteModelS from '../assets/compositor\ 1.png'
import redModelS from '../assets/compositor\ (1)\ 1.png'
import ModelOrderConfiguration from './ModelOrderConfigurations'
import {fetchModelConfiguration} from '../actions'

class ModelOrderMainPage extends Component {
    constructor(props) {
        super(props)

        this.onOrderClick = this.onOrderClick.bind(this);
      }

  componentWillReceiveProps(nextProps) {

  }

  onOrderClick = () => {
    const {history} = this.props

    history.push('/modelOrder')
  }

  componentDidMount() {
    const { location } = this.props
    const { modelName } = location.state
    const { getModelConfig } = this.props

    getModelConfig(modelName)
  }


  render() {
    const { location, selectedModelConfig } = this.props
    const { modelName } = location.state

    return (
        <div>
        {selectedModelConfig ? 
        (<Grid container>
                <Grid item lg={7}>
                    <img src={whiteModelS} alt='modelS' style={{width: '100%'}}/>
                </Grid>
                <Grid item lg={5}>
                    <ModelOrderConfiguration modelName= {modelName}/>
                </Grid>
            </Grid>
        ) : null }
        </div>
    )
  }
}

/**
 * Function to call the action to call API to send login credentials for verification
 */
function mapDispatchToProps(dispatch) {
  return {
      getModelConfig: (model) => dispatch(fetchModelConfiguration(model))
  }
}
/**
 * Function to receive the state of login api call response
 */
function mapStateToProps(state) {
  return {
    selectedModelConfig: state.allCarReducer.selectedModelConfig
  }
}

export default compose(
  connect(
    mapStateToProps,
    mapDispatchToProps
  )
)(ModelOrderMainPage)
